import React, { useState } from "react";
import "../../Assets/Fonts/LemonMilkRegularFont.css";

type Section = "about" | "projects" | "contact" | "freelance"



const LayoutDynamic: React.FC = () => {
    const [section, setSection] = React.useState<Section>("about")
    return <div className="container-fluid bg-white border-bottom border-warning border-2 " style={{padding: "10px"}}>
        <div style={{}} className="bg-white">
            <nav className="nav d-flex justify-content-between align-items-center flex-wrap" style={{margin: "auto"}}>
                <button onClick={() => setSection("about")} className="lemonmilkregular-font-medium">About Me</button>
                <button onClick={() => setSection("projects")} className="lemonmilkregular-font-medium">My Projects</button>
                <button onClick={() => setSection("freelance")} className="lemonmilkregular-font-medium">Freelancing</button>
                <button onClick={() => setSection("contact")} className="lemonmilkregular-font-medium">Contact Me</button>
            </nav>
        </div>
    </div>
}

export default LayoutDynamic;
